window.bookSummaryJSON = "<p><b>The Fool has been hunted. But he must become the hunter.</b></p> <p>Accompanying an expedition of wizards, Alex has proved himself against the dangers of Greymoor, calling upon summoned servants to defeat the Ravenerâ€™s hunters. But with the death of his pursuers, no answers are apparent, only more questions.</p> <p>And now Alex, the Heroes, his cabal, and the mighty Baelin seek answers in the ancient Crymlyn swamp, which the Sage of Thameland calls home.<br> <br> But other eyes also watch the Crymlyn. Evil eyes. Demonic eyes.<br> <br> And the Ravener is far from done with Alex.<br> <br> For it has yet to call upon its more powerful servants....</p> <p><b>Book five of the best-selling series. Continue your fantastical journey into a coming of age magic academy fantasy with a weak-to-strong progression into power, deepening mystery, a setting inspired by D&amp;D, detailed world building and magical science, action, comedy, slice-of-life, and GameLit elements.</b></p>"; 
